<!doctype html>
<html lang="en">
  <head>
    <meta charset="UTF-8" />
    <meta name="viewport" content="width=device-width, initial-scale=1.0" />
    <title>FLUX Image Generator</title>
    <script src="https://cdn.tailwindcss.com"></script>
  </head>
  <body class="bg-gray-100 min-h-screen py-12 px-4 sm:px-6 lg:px-8">
    <div
      class="max-w-md mx-auto bg-white rounded-xl shadow-md overflow-hidden md:max-w-2xl"
    >
      <div class="p-8">
        <h1 class="text-2xl font-bold text-center text-gray-900 mb-6">
          FLUX Image Generator
        </h1>
        <div class="space-y-6">
          <div class="flex justify-center space-x-4">
            <label class="inline-flex items-center">
              <input
                type="radio"
                class="form-radio"
                name="model"
                value="schnell"
                checked
              />
              <span class="ml-2">FLUX.1-schnell</span>
            </label>
            <label class="inline-flex items-center">
              <input type="radio" class="form-radio" name="model" value="dev" />
              <span class="ml-2">FLUX.1-dev</span>
            </label>
          </div>
          <input
            type="text"
            id="prompt"
            placeholder="Enter your image description"
            class="w-full px-3 py-2 placeholder-gray-500 border border-gray-300 rounded-md focus:outline-none focus:ring-indigo-500 focus:border-indigo-500"
          />
          <button
            id="generate"
            class="w-full flex justify-center py-2 px-4 border border-transparent rounded-md shadow-sm text-sm font-medium text-white bg-indigo-600 hover:bg-indigo-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-indigo-500"
          >
            Generate Image
          </button>
        </div>

        <div id="loading" class="mt-4 text-center hidden">
          <p class="text-gray-600">Generating image...</p>
        </div>

        <div id="progress-container" class="mt-4 hidden">
          <div
            class="overflow-hidden h-2 mb-4 text-xs flex rounded bg-indigo-200"
          >
            <div
              id="progress-bar"
              class="shadow-none flex flex-col text-center whitespace-nowrap text-white justify-center bg-indigo-500"
              style="width: 0%"
            ></div>
          </div>
        </div>

        <div id="error" class="mt-4 text-center text-red-600"></div>

        <div id="result" class="mt-6"></div>

        <div class="mt-4 flex space-x-2">
          <button
            id="download"
            class="flex-1 py-2 px-4 border border-transparent rounded-md shadow-sm text-sm font-medium text-white bg-green-600 hover:bg-green-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-green-500 hidden"
          >
            Download Image
          </button>
          <button
            id="send-telegram"
            class="flex-1 py-2 px-4 border border-transparent rounded-md shadow-sm text-sm font-medium text-white bg-blue-600 hover:bg-blue-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-blue-500 hidden"
          >
            Send to Telegram
          </button>
        </div>

        <div id="history" class="mt-8">
          <div class="flex justify-between items-center mb-4">
            <h2 class="text-xl font-semibold text-gray-900">
              Generation History
            </h2>
            <button
              id="clear-all"
              class="text-sm bg-red-500 hover:bg-red-600 text-white py-1 px-2 rounded"
            >
              Clear All History
            </button>
          </div>
          <ul id="history-list" class="space-y-4"></ul>
        </div>
      </div>
    </div>

    <!-- Modal for image preview -->
    <div
      id="preview-modal"
      class="fixed inset-0 bg-black bg-opacity-50 flex items-center justify-center hidden z-50"
    >
      <div class="bg-white p-4 rounded-lg max-w-3xl max-h-[90vh] overflow-auto">
        <img
          id="preview-image"
          src=""
          alt="Preview"
          class="max-w-full h-auto"
        />
        <button
          id="close-preview"
          class="mt-4 w-full bg-red-500 text-white py-2 px-4 rounded hover:bg-red-600"
        >
          Close
        </button>
      </div>
    </div>
